import React from 'react';
import './CharacterCard.css';

function CharacterCard(props) {
  return (
    <div className="character-card">
      <img src={props.image} alt={props.name} className="character-image" />
      <div className="character-details">
        <h2 className="character-name">{props.name}</h2>
        <p className="character-info"><strong>Status:</strong> {props.status}</p>
        <p className="character-info"><strong>Species:</strong> {props.species}</p>
        <p className="character-info"><strong>Type:</strong> {props.type}</p>
        <p className="character-info"><strong>Gender:</strong> {props.gender}</p>
        <p className="character-info"><strong>Origin:</strong> {props.origin}</p>
        <p className="character-info"><strong>Location:</strong> {props.location}</p>
        <p className="character-info"><strong>Episodes:</strong> {props.episodes}</p>
      </div>
    </div>
  );
}

export default CharacterCard;
